name       : python-googleapis-common-protos
version    : 1.57.0
release    : 4
source     :
    - https://files.pythonhosted.org/packages/source/g/googleapis-common-protos/googleapis-common-protos-1.56.1.tar.gz : 6b5ee59dc646eb61a8eb65ee1db186d3df6687c8804830024f32573298bca19b
homepage   : https://github.com/googleapis/python-api-common-protos
license    : Apache-2.0
component  : programming.python
summary    : Common protobufs used in Google APIs
description: |
    googleapis-common-protos contains the python classes generated from the common protos in the googleapis/api-common-protos repository.
builddeps  :
    - python-build
    - python-installer
    - python-setuptools
rundeps    :
    - python-protobuf
build      : |
    %python3_setup
install    : |
    %python3_install
